import Item from "../Item/Item"
import {Link} from 'react-router-dom'
const ItemList = ({productos}) => {
  return (
       <ul>
      {productos.map((producto) => (
        <a to='/item'>
          <Item key={producto.id} producto={producto}/>
        </a>  
        ))}
      </ul> 
  )
}

export default ItemList
